import React from 'react';
import RecipeList from './components/RecipeList';
import RecipeByCuisine from './components/RecipeByCuisine';
import CommonIngredients from './components/CommonIngredients';
import AddRecipe from './components/AddRecipe';

function App() {
  return (
    <div className="App">
      <h1>Recipe App</h1>
      <RecipeList />
      <RecipeByCuisine />
      <CommonIngredients />
      <AddRecipe />
    </div>
  );
}

export default App;
